<script>
    $('.tasksBtn').on('click', function () {
        $('#' + $(this).attr('name') + '_Task').show();
    });
    $('.cancelTask').on('click', function () {
        $('#' + $(this).attr('name') + '_Task').hide();
    });
    $('.submitTask').on('click', function () {
        var name = $(this).attr('name');
        $('#' + name + '_Task').hide();
        var typeId = name.split(""_"");
        typeId = typeId[typeId.length - 1];
